import React, { useState } from 'react';
import { Link, useNavigate } from "react-router-dom"
import { useAuth } from '../Auth/Auth';
import HomeIcon from '@mui/icons-material/Home';
import SellIcon from '@mui/icons-material/Sell';
import ViewListIcon from '@mui/icons-material/ViewList';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import LogoutIcon from '@mui/icons-material/Logout';
import DashboardIcon from '@mui/icons-material/Dashboard';
import '../../styles/global.css';
import '../../styles/profile.css'

const Navbar = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();
  const [isCollapsed, setIsCollapsed] = useState(false);

  const handleLogout = () => {
    logout();
    navigate('/login');
  };
  return (
    <div className={`sidebar ${isCollapsed ? 'collapsed' : ''}`}>
      <div className="sidebar-header">
        <Link className="brand">
        <DashboardIcon />
          {!isCollapsed && <span>Delron</span>}
        </Link>
        <button 
          className="collapse-btn"
          onClick={() => setIsCollapsed(!isCollapsed)}
        >
          {isCollapsed ? '→' : '←'}
        </button>
      </div>

      <div className="user-profile">
        {!isCollapsed && (
          <Link className="user-info" to='/profile'>
            <span className="user-name">{`${user?.lastName || ''} ${user?.firstName || ''}`}</span>
            <span className="user-role">{user?.role}</span>
          </Link>
        )}
      </div>

      <nav className="sidebar-nav">
        <Link to="/catalog" className="nav-item">
        <ViewListIcon />
        {!isCollapsed && <span>Каталог</span>}
        </Link>
        <Link to="/sells" className="nav-item">
        <SellIcon />
        {!isCollapsed && <span>Продажи</span>}
        </Link>
        <Link to="/order" className="nav-item">
        <ShoppingCartIcon />
        {!isCollapsed && <span>Заказы</span>}
        </Link>
      </nav>

      <div className="sidebar-footer">
        <button onClick={handleLogout} className="logout-btn">
        <LogoutIcon />
        {!isCollapsed && <span>Выйти</span>}
        </button>
      </div>
    </div>
  );  
};

export default Navbar;
